import './../css/App.css';
import HeaderTop from './HeaderTop';
import Menu from './Menu';
import Search from './Search';
import Carousel from './Carousel';
import JobContent from './JobContent';
function App() {
  return (
    <div className="App">
      <HeaderTop/>
      <Menu/>
      <Search/>
      <Carousel/>
    </div>
  );
}

export default App;
